import React from 'react';
import './App.css';
import Game from './Game';
import Login from './Login';
import Signup from './Signup';

function App() {
  return (
    <div>
      <div className='login'><Login /></div>
      <div className='signup'><Signup /></div>
      <div className='game'><Game /></div>
    </div>
  );
}

export default App;
